import './Sidebar.css';

const Sidebar=()=> {

    return(
        <div>
            <div class="wrapper">
                <nav id="sidebar">
                    <div class="sidebar-header">
                    <h3>Bootstrap Sidebar</h3>
                    </div>


                </nav>
            </div>
        </div>
    );
}



export default Sidebar;
